import React, { useState, useEffect } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import Header from '../sharedpages/header';
import Navbar from '../sharedpages/navbar';
import Footer from '../sharedpages/footer';
import './comparison.css';

const Comparison = () => {
  const [activeTab, setActiveTab] = useState('compare-predictions');
  const [showProfileDropdown, setShowProfileDropdown] = useState(false);
  const navigate = useNavigate();
  const location = useLocation();
  
  // Get comparison data from navigation state
  const properties = location.state?.properties || [
    {
      id: 1,
      propertyType: 'Industrial Property',
      address: '123 Main Street, Singapore',
      floorArea: '1,500',
      level: 'Ground Floor',
      unit: 'A1'
    },
    {
      id: 2,
      propertyType: 'Commercial Space',
      address: '456 Oak Avenue, Singapore',
      floorArea: '2,000',
      level: 'Level 1',
      unit: 'B2'
    }
  ];

  // Get user type from localStorage
  const userType = localStorage.getItem('userType') || 'free';

  // Mock comparison data
  const comparisonData = {
    property1: {
      ...properties[0],
      estimatedValue: '$2.5M - $2.8M',
      conservative: '$2.5M - $2.8M',
      aggressive: '$2.5K - $2.8K',
      landArea: '1,000 sqft',
      builtUpArea: '1,500 sqft',
      yearOfCompletion: '2000',
      tenure: '99 years',
      zoning: 'B2',
      district: '22',
      storeys: '3',
      units: '10',
      occupancyRate: '90%'
    },
    property2: {
      ...properties[1],
      estimatedValue: '$3.2M - $3.6M',
      conservative: '$3.2M - $3.6M',
      aggressive: '$3.2K - $3.6K',
      landArea: '1,200 sqft',
      builtUpArea: '2,000 sqft',
      yearOfCompletion: '2005',
      tenure: '99 years',
      zoning: 'B1',
      district: '21',
      storeys: '4',
      units: '15',
      occupancyRate: '85%'
    }
  };

  const handleProfileClick = () => {
    setShowProfileDropdown(!showProfileDropdown);
  };

  const handleProfilePage = () => {
    setShowProfileDropdown(false);
    navigate('/profile');
  };

  const handleLogout = () => {
    setShowProfileDropdown(false);
    localStorage.removeItem('isLoggedIn');
    localStorage.removeItem('userType');
    localStorage.removeItem('userPreferences');
    navigate('/login');
  };

  const handleClickOutside = (e) => {
    if (!e.target.closest('.user-profile')) {
      setShowProfileDropdown(false);
    }
  };

  const handleNavigation = (itemId) => {
    setActiveTab(itemId);
    
    switch (itemId) {
      case 'dashboard':
        navigate('/dashboard/free');
        break;
      case 'price-prediction':
        navigate('/dashboard/priceprediction');
        break;
      case 'compare-predictions':
        navigate('/dashboard/compareprediction');
        break;
      case 'bookmarks':
        navigate('/bookmarks');
        break;
      case 'support':
        navigate('/support');
        break;
      case 'feedback':
        navigate('/feedback');
        break;
      case 'profile':
        navigate('/profile');
        break;
      default:
        break;
    }
  };

  useEffect(() => {
    document.addEventListener('click', handleClickOutside);
    return () => {
      document.removeEventListener('click', handleClickOutside);
    };
  }, []);

  return (
    <div className="comparison-dashboard">
      <Header />
      <div className="dashboard-container">
        <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />
        <main className="main-content">
          <div className="content-header">
            <h1 className="main-title">Property Comparison Results</h1>
            <p className="subtitle">Comparing {properties.length} properties</p>
          </div>

          <div className="comparison-container">
            {/* Property Cards */}
            <div className="property-cards">
              <div className="property-card">
                <div className="property-header">
                  <h2>Property 1</h2>
                  <span className="property-type">{comparisonData.property1.propertyType}</span>
                </div>
                <div className="property-address">{comparisonData.property1.address}</div>
                <div className="property-details">
                  <div className="detail-item">
                    <span className="label">Floor Area:</span>
                    <span className="value">{comparisonData.property1.floorArea} sq ft</span>
                  </div>
                  <div className="detail-item">
                    <span className="label">Level:</span>
                    <span className="value">{comparisonData.property1.level}</span>
                  </div>
                  <div className="detail-item">
                    <span className="label">Unit:</span>
                    <span className="value">{comparisonData.property1.unit}</span>
                  </div>
                </div>
              </div>

              <div className="vs-indicator">VS</div>

              <div className="property-card">
                <div className="property-header">
                  <h2>Property 2</h2>
                  <span className="property-type">{comparisonData.property2.propertyType}</span>
                </div>
                <div className="property-address">{comparisonData.property2.address}</div>
                <div className="property-details">
                  <div className="detail-item">
                    <span className="label">Floor Area:</span>
                    <span className="value">{comparisonData.property2.floorArea} sq ft</span>
                  </div>
                  <div className="detail-item">
                    <span className="label">Level:</span>
                    <span className="value">{comparisonData.property2.level}</span>
                  </div>
                  <div className="detail-item">
                    <span className="label">Unit:</span>
                    <span className="value">{comparisonData.property2.unit}</span>
                  </div>
                </div>
              </div>
            </div>

            {/* Prediction Results */}
            <div className="prediction-results">
              <h2>Price Predictions</h2>
              <div className="prediction-cards">
                <div className="prediction-card">
                  <h3>Property 1 Predictions</h3>
                  <div className="prediction-item">
                    <span className="prediction-label">Estimated Value:</span>
                    <span className="prediction-value">{comparisonData.property1.estimatedValue}</span>
                  </div>
                  <div className="prediction-item">
                    <span className="prediction-label">Conservative:</span>
                    <span className="prediction-value">{comparisonData.property1.conservative}</span>
                  </div>
                  <div className="prediction-item">
                    <span className="prediction-label">Aggressive:</span>
                    <span className="prediction-value">{comparisonData.property1.aggressive}</span>
                  </div>
                </div>

                <div className="prediction-card">
                  <h3>Property 2 Predictions</h3>
                  <div className="prediction-item">
                    <span className="prediction-label">Estimated Value:</span>
                    <span className="prediction-value">{comparisonData.property2.estimatedValue}</span>
                  </div>
                  <div className="prediction-item">
                    <span className="prediction-label">Conservative:</span>
                    <span className="prediction-value">{comparisonData.property2.conservative}</span>
                  </div>
                  <div className="prediction-item">
                    <span className="prediction-label">Aggressive:</span>
                    <span className="prediction-value">{comparisonData.property2.aggressive}</span>
                  </div>
                </div>
              </div>
            </div>

            {/* Detailed Comparison Table */}
            <div className="comparison-table-section">
              <h2>Detailed Comparison</h2>
              <div className="comparison-table">
                <div className="table-header">
                  <div className="table-cell">Property Details</div>
                  <div className="table-cell">Property 1</div>
                  <div className="table-cell">Property 2</div>
                </div>
                <div className="table-row">
                  <div className="table-cell">Land Area</div>
                  <div className="table-cell">{comparisonData.property1.landArea}</div>
                  <div className="table-cell">{comparisonData.property2.landArea}</div>
                </div>
                <div className="table-row">
                  <div className="table-cell">Built-up Area</div>
                  <div className="table-cell">{comparisonData.property1.builtUpArea}</div>
                  <div className="table-cell">{comparisonData.property2.builtUpArea}</div>
                </div>
                <div className="table-row">
                  <div className="table-cell">Year of Completion</div>
                  <div className="table-cell">{comparisonData.property1.yearOfCompletion}</div>
                  <div className="table-cell">{comparisonData.property2.yearOfCompletion}</div>
                </div>
                <div className="table-row">
                  <div className="table-cell">Tenure</div>
                  <div className="table-cell">{comparisonData.property1.tenure}</div>
                  <div className="table-cell">{comparisonData.property2.tenure}</div>
                </div>
                <div className="table-row">
                  <div className="table-cell">Zoning</div>
                  <div className="table-cell">{comparisonData.property1.zoning}</div>
                  <div className="table-cell">{comparisonData.property2.zoning}</div>
                </div>
                <div className="table-row">
                  <div className="table-cell">District</div>
                  <div className="table-cell">{comparisonData.property1.district}</div>
                  <div className="table-cell">{comparisonData.property2.district}</div>
                </div>
                <div className="table-row">
                  <div className="table-cell">Storeys</div>
                  <div className="table-cell">{comparisonData.property1.storeys}</div>
                  <div className="table-cell">{comparisonData.property2.storeys}</div>
                </div>
                <div className="table-row">
                  <div className="table-cell">Units</div>
                  <div className="table-cell">{comparisonData.property1.units}</div>
                  <div className="table-cell">{comparisonData.property2.units}</div>
                </div>
                <div className="table-row">
                  <div className="table-cell">Occupancy Rate</div>
                  <div className="table-cell">{comparisonData.property1.occupancyRate}</div>
                  <div className="table-cell">{comparisonData.property2.occupancyRate}</div>
                </div>
              </div>
            </div>

            {/* Action Buttons */}
            <div className="action-buttons">
              <button className="btn btn-secondary" onClick={() => navigate('/dashboard/compareprediction')}>
                Compare More Properties
              </button>
              <button className="btn btn-primary" onClick={() => navigate('/dashboard/priceprediction')}>
                New Price Prediction
              </button>
            </div>
          </div>
        </main>
      </div>
      <Footer />
    </div>
  );
};

export default Comparison;
